import "./Image.scss";
import WomanDesigning from "../../assets/images/woman-designing.jpg";
import PaperPlane from "../../assets/images/paper-plane.jpg";

export const ImageHeroAbout = () => {
    return (
        <section className="image__container--about">
            <img src={WomanDesigning} alt="woman designing" />
        </section>
    );
};

export const ImageHeroContact = () => {
    return (
        <section className="image__container--contact">
            <img src={PaperPlane} alt="people throwing paper plane" />
        </section>
    );
};
